import '../estilos/SkillsBanner.css';

export default function CardSkill(props){
    const habilidade = props.habilidade;
    const icone = props.icone;
    return(
        <div className="card">
            <h2>{habilidade}</h2>
            {<img src="<?php echo INCLUDE_PATH; ?>imagens/jesussalva.png" alt="Jesus Salva"/>}
            <p>O <strong>SÍMBOLO</strong> da salvação é a <strong>CRUZ</strong>. Está vazia porque Cristo vive.
                Está simbolizado na bandeira pela cor <strong>VERMELHA</strong>, tipificando o sangue de Jesus derramado pela humanidade.
                O evangelho de Lucas apresenta Jesus Cristo, o Salvador que <i>“veio buscar e 
                salvar o que se havia perdido”.</i> (Lucas 19:10).</p>
        </div>
    );
}
